loadConfiguration(); // Side effect: Connect to external service connectToExternalAPI(); } public User getUser(Long id) { // Side effect: Database query return userRepository.findById(id); }\\n}","breadcrumbs":"Chapter 5: useEffect v√† Lifecycle ¬ª C√°c lo·∫°i Side Effects ph·ªï bi·∫øn","id":"173","title":"C√°c lo·∫°i Side Effects ph·ªï bi·∫øn"},"174":{"body":"useEffect cho ph√©p th·ª±c hi·ªán side effects trong functional component.","breadcrumbs":"Chapter 5: useEffect v√† Lifecycle ¬ª ü™ù useEffect Hook","id":"174","title":"ü™ù useEffect Hook"},"175":{"body":"import { useEffect } from \'react\'; function MyComponent() { useEffect(() => { // Code ch·∫°y sau m·ªói l·∫ßn render console.log(\\"Component rendered\\"); }); return <div>Hello</div>;\\n}","breadcrumbs":"Chapter 5: useEffect v√† Lifecycle ¬ª C√∫ ph√°p c∆° b·∫£n","id":"175","title":"C√∫ ph√°p c∆° b·∫£n"},"176":{"body":"useEffect(() => { // 1. Setup logic (side effect) console.log(\\"Effect running\\"); // 2. Cleanup function (optional) return () => { console.log(\\"Cleanup\\"); };\\n}, [dependencies]); // 3. Dependency array (optional)","breadcrumbs":"Chapter 5: useEffect v√† Lifecycle ¬ª C√∫ ph√°p ƒë·∫ßy ƒë·ªß","id":"176","title":"C√∫ ph√°p ƒë·∫ßy ƒë·ªß"},"177":{"body":"function ExampleComponent() { const [count, setCount] = useState(0); const [name, setName] = useState(\\"\\"); // 1Ô∏è‚É£ Kh√¥ng c√≥ dependency array ‚Üí Ch·∫°y sau M·ªñI render useEffect(() => { console.log(\\"Ch·∫°y sau m·ªói render\\"); }); // 2Ô∏è‚É£ Empty dependency array [] ‚Üí Ch·ªâ ch·∫°y 1 l·∫ßn (mount) useEffect(() => { console.log(\\"Ch·∫°y 1 l·∫ßn khi component mount\\"); }, []); // 3Ô∏è‚É£ C√≥ dependencies ‚Üí Ch·∫°y khi dependencies thay ƒë·ªïi useEffect(() => { console.log(\\"Ch·∫°y khi count thay ƒë·ªïi\\"); }, [count]); return ( <div> <button onClick={() => setCount(count + 1)}>Count: {count}</button> <input value={name} onChange={(e) => setName(e.target.value)} /> </div> );\\n}","breadcrumbs":"Chapter 5: useEffect v√† Lif